import React, { useEffect, useState } from 'react'
import axios from 'axios'
import '../Main/dashboard.css'; 
import Sidebar from '../Sidebar/sidebar';

const Cars = ({ user }) => {
  const [cars, setCars] = useState([])
  useEffect(() => {
    const getCars = async () => {
      if (user && (user.rank === 'Client' || user.rank === 'Admin')) {
        try {
          const response = await axios.get(`http://localhost:5000/dashboard/cars?email=${user.email}`)
          setCars(response.data)
        } catch (error) {
          console.error('Failed to fetch cars', error)
        }
      } else {
        setCars([])
      }
    }

    getCars()
  }, [user])
  return (
    <>
      <Sidebar user={user} />
      <div className="bigbox">
        <h1>YOUR CARS</h1>
        {cars.map(car => (
          <p key={car.id}>{car.name}</p>
        ))}
      </div>
    </>
  )
}

export default Cars
